import React, { useEffect, useRef } from 'react';

const Team: React.FC = () => {
  const leftRef = useRef<HTMLDivElement | null>(null);
  const rightRef = useRef<HTMLDivElement | null>(null);

  useEffect(() => {
    const targets: (Element | null)[] = [leftRef.current, rightRef.current];
    const observer = new IntersectionObserver(
      (entries, obs) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            entry.target.classList.add('visible');
            obs.unobserve(entry.target);
          }
        });
      },
      { threshold: 0.3 }
    );
    targets.forEach((t) => t && observer.observe(t));
    return () => observer.disconnect();
  }, []);

  return (
    <main className="page page--team">
    <div className="page-content page-content--team">
      <h1 className="work-fade">Team</h1>
        <section className="team-grid">
          <div className="team-column work-fade" ref={leftRef}>
            <img className="team-photo" src="/Alex.jpg" alt="Alexander Sky portrait" />
            <div className="team-bio">
              <h2>Alexander Sky Bischof</h2>
              <p>
                Director / DP specializing in outdoor commercials and documentaries based in Sydney, Australia.
              </p>
              <a className="portfolio-link" href="https://alexanderskyb.com/" target="_blank" rel="noopener noreferrer">
                Click to view portfolio
              </a>
              <div className="team-socials">
                <a href="https://www.instagram.com/askypic" target="_blank" rel="noopener noreferrer" className="social-link">
                  <img src="igicon.png" alt="Instagram" />
                </a>
                <a href="https://www.tiktok.com/@kinnoshitasky" target="_blank" rel="noopener noreferrer" className="social-link">
                  <img src="ttlogo.png" alt="TikTok" />
                </a>
                <a href="https://www.youtube.com/@kinoshitasky" target="_blank" rel="noopener noreferrer" className="social-link">
                  <img src="ytgreenlogo.png" alt="YouTube" />
                </a>
              </div>
            </div>
          </div>

          <div className="team-divider" aria-hidden="true"></div>

          <div className="team-column work-fade" ref={rightRef}>
            <img className="team-photo" src="/Tomoki.jpg" alt="Tomoki Narukawa portrait" />
            <div className="team-bio">
              <h2>Tomoki Narukawa</h2>
              <p>
                Producer / Editor focused on high-impact outdoor storytelling and branded content.
              </p>
              <a className="portfolio-link" href="https://tomokina.com/" target="_blank" rel="noopener noreferrer">
                Click to view portfolio
              </a>
              <div className="team-socials">
                <a href="https://www.instagram.com/askypic" target="_blank" rel="noopener noreferrer" className="social-link">
                  <img src="igicon.png" alt="Instagram" />
                </a>
                <a href="https://www.tiktok.com/@kinnoshitasky" target="_blank" rel="noopener noreferrer" className="social-link">
                  <img src="ttlogo.png" alt="TikTok" />
                </a>
                <a href="https://www.youtube.com/@kinoshitasky" target="_blank" rel="noopener noreferrer" className="social-link">
                  <img src="ytgreenlogo.png" alt="YouTube" />
                </a>
              </div>
            </div>
          </div>
        </section>
      </div>
    </main>
  );
};

export default Team;
